INSERT INTO `products` (`id`, `title`, `product_categorie_id`, `imagen`, `sku`, `state`, `state_stock`, `price_general`, `description`, `specifications`, `is_discount`, `min_discount`, `max_discount`, `is_gift`, `tax_selected`, `importe_iva`, `umbral`, `umbral_unit_id`, `disponiblidad`, `tiempo_de_abastecimiento`, `provider_id`, `weight`, `width`, `height`, `length`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Filtro de aceite de larga duración STP S11427XL', 2, 'products/hLFdZ6pHtMQnZtbQXB7MKYfBSMgy2VlZVi07DH4y.jpg', '644034', 1, 3, 43, 'Los filtros de aceite STP de larga duración brindan la máxima protección para el motor de su vehículo. Su mezcla sintética superior atrapa contaminantes con una eficiencia del 99 % durante la vida útil del filtro.', '[]', 2, 5, 15, 1, 1, 10, 5, 2, 2, 2, 1, 5, 15, 5, 6, '2024-05-01 06:04:21', '2024-05-06 04:30:09', NULL),
(2, 'Faro delantero izquierdo Chevrolet Suburban/Tahoe 2015-2017', 4, 'products/PzhoVF6PWbRt8c7QhodLFwqVFMkxYScITsgbmZpE.jpg', '82424017', 1, 1, 6500, 'El faro delantero es una unidad de iluminación para la conducción nocturna y aumenta la visibilidad en condiciones de poca luz. Suelen incluir luces de cruce, luces de carretera y luces intermitentes.', '[]', 2, 25, 35, 1, 1, 0, 4, 5, 1, 2, 2, 2, 2, 1, 3, '2024-05-01 06:09:38', '2024-05-10 04:31:20', NULL),
(3, 'Biela de motor Chevrolet N300 2011-2024', 2, 'products/1OnOsXvthKLXaAcDrmXx9dqC2NLEf1yKEX2uxdd7.jpg', '84070008', 1, 2, 85, 'La biela conecta el pistón al cigüeñal y transfiere la energía generada por la combustión al movimiento de rotación. Presenta un cuerpo alargado con un extremo unido al pistón y otro al cigüeñal mediante cojinetes.', '[{\"key_v\":\"Peso\",\"value_v\":\"9.47 libras\"}]', 1, 0, 0, 2, 1, 0, 3, 5, 3, 2, 2, 0.5, 1.5, 2, 3, '2024-05-01 06:59:51', '2024-05-06 04:30:09', NULL),
(4, 'Aceite de motor Castrol EDGE totalmente sintético 10W-30 5 cuartos', 1, 'products/Cch15dTf6XMT1n9kR76gqqpIBofSj1vRwQ4BdzUs.png', '82424017', 1, 1, 73, 'Castrol® EDGE®, diseñado con Fluid TITANIUM Technology™, proporciona una resistencia de aceite de motor superior para motores que trabajan más duro debido a presiones más altas, ayudando a su vehículo a maximizar su rendimiento. Proporciona una protección superior en motores de gasolina de inyección directa (incluidos, entre otros, GDI, FSI, SIDI, EcoBoost; consulte el manual del propietario para obtener más detalles)', '[{\"key_v\":\"Composición del aceite\\t\",\"value_v\":\"Completamente sintético\"},{\"key_v\":\"Ciclo\",\"value_v\":\"4 ciclos\"}]', 2, 5, 20, 1, 2, 8, 2, 2, 2, 3, 2, 2, 5, 3, 3, '2024-05-01 07:10:46', '2024-05-16 05:27:46', NULL),
(8, 'Sensor map Chevrolet Sail 1.5 2016-/', 1, 'https://ipsautopartes.com.pe/wp-content/uploads/2021/10/SENSOR-MAP-CHEVROLET-SAIL-1.5-2016-1-1.jpg', '48030001', 1, 1, 125, 'El sensor es un componente electrónico que envía señales al sistema de control del automóvil, lo que permite monitorear variables como la temperatura y ajustar diversos parámetros para un rendimiento óptimo', NULL, 1, NULL, NULL, 2, 1, 40, 5, 5, 1, NULL, NULL, 5, 15, NULL, NULL, '2024-05-04 09:04:18', '2024-05-04 09:04:18', NULL),
(9, 'Bomba de agua Suzuki Swift 2014-2017', 2, 'https://ipsautopartes.com.pe/wp-content/uploads/2021/10/BOMBA-DE-AGUA-SUZUKI-SWIFT-2014-2017-1.jpg', '84800005', 1, 2, 225, 'La bomba de agua circula el líquido refrigerante a través del motor y el radiador para disipar el calor generado durante el funcionamiento. Crea un flujo de agua constante, por medio de un impulsor.', NULL, 1, NULL, NULL, 1, 2, 55, 2, 2, 2, NULL, NULL, 14, 2, NULL, NULL, '2024-05-04 09:04:18', '2024-05-08 12:25:08', NULL),
(10, 'Amortiguador delantero derecho Chery New Tiggo 3 2015-2019', 2, 'products/WUssqwyYtkWucfppInDWPftLBBZTIKt8hPaGtkfi.jpg', '77200060', 1, 1, 125, 'El amortiguador está diseñado con un pistón y una serie de válvulas que regulan el flujo de aceite para amortiguar los impactos y las vibraciones. Establece una conexión entre neumáticos y suelo.', NULL, 1, 0, 0, 1, 1, 0, 4, 5, 1, 2, NULL, 1, 1, 1, 1, '2024-05-09 16:19:05', '2024-05-09 16:19:05', NULL),
(11, 'Amortiguador delantero derecho JAC S3 2015-2018', 2, 'products/NCOqLdimgtjmzkvfe2v7tXjdYGxzbWO062XguMuf.jpg', '77200052', 1, 1, 178, 'El amortiguador está diseñado con un pistón y una serie de válvulas que regulan el flujo de aceite para amortiguar los impactos y las vibraciones. Establece una conexión entre neumáticos y suelo.', NULL, 1, 0, 0, 1, 2, 5, 4, 5, 2, 3, NULL, 2, 2, 2, 2, '2024-05-09 16:27:00', '2024-05-09 16:27:00', NULL),
(12, 'Faro delantero derecho Chevrolet N400 2021-2023', 4, 'products/jzIxmsVBuALF7F8EPgCcByoVeT3VpjEbiOipo5kp.jpg', '80006459', 1, 1, 175, 'El faro delantero es una unidad de iluminación para la conducción nocturna y aumenta la visibilidad en condiciones de poca luz. Suelen incluir luces de cruce, luces de carretera y luces intermitentes.\r\n\r\nCOD OEM: 23983184', '[]', 2, 5, 17, 1, 2, 5, 4, 5, 3, 2, NULL, 2, 3, 1, 2, '2024-05-09 16:35:50', '2024-05-25 07:37:50', NULL),
(13, 'Bocamaza de rueda delantera Chevrolet Sail 1.5 2016-/', 5, 'products/H9L8XvA5tUGZlnIuDdjKbs7dvuZ4QnYTS2YLsK9V.jpg', '76100007', 1, 1, 175, 'La bocamaza es una abertura en la llanta de un vehículo, donde se inserta y se asegura la válvula del neumático. Permite inflar y desinflar el neumático, verificar la presión de aire y ventilar los frenos.', '[]', 2, 5, 20, 1, 1, 0, 3, 5, 1, 2, NULL, 2, 14, 5, 6, '2024-05-09 16:41:45', '2024-05-17 07:15:53', NULL),
(14, 'Bocamaza de rueda posterior Chevrolet Sail 1.5 2016-/', 5, 'products/i10uCP7MFnJiNZZFxc5uROvFU1eh8UM75KQ4LLnx.jpg', '76120002', 1, 1, 140, 'La bocamaza es una abertura en la llanta de un vehículo, donde se inserta y se asegura la válvula del neumático. Permite inflar y desinflar el neumático, verificar la presión de aire y ventilar los frenos.', NULL, 1, 0, 0, 1, 1, 0, 3, 5, 1, 2, NULL, 1, 2, 4, 2, '2024-05-09 16:58:44', '2024-05-09 16:58:44', NULL),
(15, 'Cilindro auxiliar de embrague Chevrolet Sail', 7, 'products/wOa9NdT2gJMpw96471GiUYikptUoLPoy2kOUOe8s.jpg', '75110001', 1, 1, 140, 'El cilindro auxiliar de embrague actúa como enlace entre el pedal de embrague y el sistema hidráulico del embrague. Transmite la fuerza hidráulica al cilindro principal, liberando o accionando el embrague.', NULL, 2, 2, 5, 2, 2, 6, 6, 5, 1, 0, NULL, 1, 2, 3, 4, '2024-05-09 17:04:03', '2024-05-09 17:04:03', NULL),
(16, 'Caliper de freno derecho Chevrolet N300 2011-2020', 6, 'products/S25kUKNHVar8QUpXyzf2lNqFYtlfK1xx2CUNB3ge.jpg', '74250024', 1, 1, 110, 'El caliper o pinza de freno se monta sobre el disco de freno y contiene las pastillas de freno. Cuando se aplica presión al pedal de freno, el caliper genera la fricción necesaria para detener el vehículo.', NULL, 1, 0, 0, 1, 1, 0, 1, 1, 1, 0, NULL, 1, 5, 4, 4, '2024-05-09 20:04:53', '2024-05-09 20:04:53', NULL),
(17, 'Jgo Pastillas de Freno Chevrolet Suburban/Tahoe 2015-2017', 6, 'products/sB4BdUhc0qZEvbtKtJDJGw3KFlTQYT6rHXnLwEMM.jpg', '82424023', 1, 1, 725, 'Las pastillas de freno están diseñadas para aplicar fricción y presión sobre los discos de freno cuando se acciona el pedal de freno. Están compuestas por material de alta resistencia que se desgastan gradualmente.', NULL, 1, 0, 0, 1, 2, 3, 2, 5, 1, 0, NULL, 2, 4, 4, 2, '2024-05-09 20:19:36', '2024-05-09 20:19:36', NULL),
(18, 'Airbag piloto Changan A500', 8, 'products/reOeONDAZd8vyPngYnJKGN51ckvbhez2GHb1VBWc.jpg', '49100002', 1, 1, 885, 'El airbag es un dispositivo de seguridad pasiva que se encuentra en el interior del vehículo. Se activa en caso de colisión y se infla rápidamente para proteger a los ocupantes del automóvil.', NULL, 1, 0, 0, 1, 1, 0, 2, 5, 2, 0, NULL, 1, 2, 3, 4, '2024-05-09 22:36:35', '2024-05-09 22:36:35', NULL),
(19, 'Árbol (eje) de levas escape Chevrolet Sail 1.4 2010-2015', 8, 'products/4jkroFqMoMO0wD6dH9iY72XiUeuwNwChbxyzWvcU.jpg', '84200003', 1, 1, 163, 'El eje de levas se ubica en la culata del motor y se acciona mediante una correa o cadena de distribución. Se encarga de controlar la apertura y cierre de las válvulas de admisión y escape.', NULL, 1, 0, 0, 1, 1, 0, 2, 5, 2, 0, NULL, 1, 2, 5, 5, '2024-05-09 22:41:06', '2024-05-09 22:41:06', NULL),
(20, 'Empaque de culata Changan A500', 9, 'products/bziXeS8bAfBqMVMSmV9b1JOVH0dxNJICM36HNYQZ.jpg', '85430001', 1, 1, 165, 'El empaque proporciona una barrera hermética y duradera, asegurando un funcionamiento óptimo y prolongando la vida útil de los componentes del vehículo. Se utiliza para evitar fugas de líquidos, gases o polvo.', NULL, 1, 0, 0, 1, 1, 0, 1, 5, 1, 0, NULL, 1, 2, 3, 4, '2024-05-09 22:46:22', '2024-05-09 22:46:22', NULL),
(21, 'Reten de salida de caja Chevrolet N300', 9, 'products/JLTD2v1RnWREWOBJoWzxxNi8LUY9JsLq4VuHNWZH.jpg', '85700001', 1, 1, 8, 'El retén se utiliza para sellar y proteger los ejes y las partes móviles de los sistemas, evitando fugas de fluidos. Se coloca en las superficies de contacto para evitar la entrada de contaminantes.', NULL, 1, 0, 0, 2, 1, 0, 2, 5, 1, 0, NULL, 2, 5, 4, 1, '2024-05-09 22:53:26', '2024-05-09 22:53:26', NULL),
(22, 'Base reflector izquierdo de parachoque posterior Suzuki Ciaz 2015-2020', 3, 'products/VPPvbuqBpR703BueBDlie7Xma6lrqOvoKl6N0gnI.jpg', '34530001', 1, 1, 130, 'La base reflector para parachoques aumenta la visibilidad y seguridad del vehículo. Colocada estratégicamente, refleja la luz para alertar a otros conductores y complementa el diseño del parachoques.', NULL, 2, 5, 15, 1, 2, 14, 2, 5, 1, 0, NULL, 1, 2, 5, 7, '2024-05-09 22:57:28', '2024-05-09 22:57:28', NULL),
(23, 'Limpiador de ruedas de servicio pesado Griot\'s Garage, 22 oz', 11, 'products/dkBIJ5abB7IU2dsa52nNVLlksnHe5QU1BpO028sj.png', '531716', 1, 1, 75, 'Heavy-Duty Wheel Cleaner es una fórmula no ácida y no cáustica con pH equilibrado que se mezcla para que se adhiera a la superficie y promueva una limpieza profunda. Rocíe Heavy-Duty Wheel Cleaner, déjelo permanecer en la rueda durante 3 a 5 minutos, agite suavemente con cualquiera de nuestras herramientas de limpieza y luego enjuague. Seguro para usar en cualquier acabado de rueda: pintado, cromado, aluminio sin recubrimiento, con recubrimiento en polvo y anodizado.', '[]', 1, 0, 0, 1, 2, 8, 1, 5, 1, 0, NULL, 1, 2, 3, 4, '2024-05-10 04:16:38', '2024-05-17 08:07:20', NULL),
(24, 'Griot\'s Garage Spray limpiador de vidrios espumoso ultra premium, 19 oz', 11, 'products/bdzHxI2EnpcFqQTBqPjq551DpMTUNpSDiAbq55Gd.png', '452005', 1, 1, 29, 'Disfrutará del fresco aroma cítrico del Ultra-Premium Glass Cleaner y apreciará los vidrios, ventanas y espejos cristalinos y sin empañamiento que crea. No contiene amoníaco. La lata grande de 19 onzas es muy útil, ya que todo lo que necesita es una ligera neblina para eliminar la suciedad del camino, los insectos, la niebla de vinilo, la película para fumadores y los residuos de gases.', '[]', 1, 0, 0, 2, 1, 0, 1, 5, 1, 0, NULL, 1, 2, 3, 8, '2024-05-10 04:23:13', '2024-05-25 05:41:09', NULL),
(25, 'Duralast 24MS-DL Grupo Tamaño 24 Batería de arranque marina 800 CCA 1000 MCA', 10, 'products/uLfzV6IEFhf6Am91rGhbdWu1f5PpWwyaEBFETHoE.png', '107675', 1, 1, 440, '¡Las baterías Duralast Marine y RV están diseñadas para llevarlo y mantenerlo en el agua! Las baterías marinas Duralast se fabrican con amperios de arranque en frío, capacidad de reserva y resistencia a las vibraciones para que pueda seguir funcionando en los exigentes entornos marinos y de vehículos recreativos.', NULL, 2, 8, 25, 1, 2, 8, 3, 5, 2, 0, NULL, 1, 2, 3, 5, '2024-05-10 04:27:29', '2024-05-10 04:27:29', NULL),
(26, 'Filtro de aire Chevrolet Suburban/Tahoe 2015-2017', 8, 'products/ihZLloLaXYnN5IL5iPW3tFCEcT3U9P9Qqc1F7Mge.jpg', 'FA-F5000', 1, 1, 245, 'El filtro de aire es una pieza esencial del sistema de admisión de aire del motor. Retiene las partículas y contaminantes presentes en el aire, evitando que ingresen al motor y dañen los componentes internos.', '[]', 2, 15, 60, 1, 1, 0, 15, 5, 1, 2, NULL, 0.5, 1, 2, 3, '2024-07-06 10:22:45', '2024-07-06 10:28:03', NULL);
